INSERT INTO `aporte` (`ID`, `TITULO`, `DESCRIPCION`, `F_CREACION`, `BASEIMG`, `PROPIETARIO`, `TIPO`) VALUES (1, 'Bruselas apunta ahora a Amazon', 'La Comisión Europea ha lanzado este jueves una investigación formal contra el gigante estadounidense del comercio electrónico Amazon al sospechar que está restringiendo la competencia en el mercado de los libros electrónicos.<br>Bruselas cree que algunas de las cláusulas de los contratos firmados por Amazon con los editores de libros electrónicos vulneran las normas de la UE porque le protegen de la competencia de rivales y perjudican a los consumidores.<br>Las disposiciones en cuestión obligan a los editores a informar a Amazon cada vez que ofrecen a sus rivales condiciones más favorables o diferentes y a concederle en todo momento condiciones análogas a las que otorgan a sus competidores.<br>El Ejecutivo comunitario quiere examinar ahora con más detalle si estas cláusulas obstaculizan la aplicación de condiciones de competencia equitativa y podrían desembocar en una disminución de la competencia entre los diferentes distribuidores de libros electrónicos, en detrimento de los consumidores.', '2015-08-10 11:52:27', 'data:image/jpeg;base64,', 'admin', 'Noticia');
INSERT INTO `aporte` (`ID`, `TITULO`, `DESCRIPCION`, `F_CREACION`, `BASEIMG`, `PROPIETARIO`, `TIPO`) VALUES (2, 'Twitter ''salta'' al dominio .eus', 'La red social Twitter ha puesto en marcha el dominio.eus y, además, en un breve espacio de tiempo identificará los "tuits" lanzados en euskera, gracias a la colaboración con la fundación PuntuEUS.<br>Según ha informado la fundación PuntuEUS a través de una nota, a día de hoy Twitter no reconoce el euskera, a pesar de que la interfaz está en euskera. Twitter ya está trabajando codo con codo junto a la fundación PuntuEUS para solucionar este asunto y, en breve, identificará los "tuits" enviados en euskera. Para ello, ambas parte están teniendo la ayuda de la empresa CodeSyntax.<br>Twitter publicó la versión en euskera en 2012. La página web UMAP recoge y filtra la actividad de los tuiteros euskaldunes y, según dicha fuente, en mayo ha habido 7.569 usuarios activos euskaldunes. En total, dichos usuarios han enviado 653.108 "tuits", de las cuales el 50,70% han sido en euskera. Así que, de media se han enviado 1.682,13 "tuits" en euskera.', '2015-08-10 11:56:29', 'data:image/jpeg;base64,', 'admin', 'Noticia');
INSERT INTO `aporte` (`ID`, `TITULO`, `DESCRIPCION`, `F_CREACION`, `BASEIMG`, `PROPIETARIO`, `TIPO`) VALUES (3, 'La UE acuerda reforzar la protección de datos en Internet', 'Los ministros de Justicia de la Unión Europea (UE) han logrado un acuerdo sobre el reglamento europeo para reforzar la protección de datos en internet y reconocieron el derecho de los ciudadanos a "ser olvidados" en la red.<br>Los Veintiocho, tras tres años de negociaciones, iniciarán ahora, antes de las vacaciones de verano, las negociaciones con el Parlamento Europeo (PE) con la intención de llegar a un acuerdo final sobre esta normativa antes de finales de año.<br>La nueva normativa incluye el derecho de los ciudadanos a "ser olvidados" en la red, es decir, a reclamar el borrado de todos los datos personales perjudiciales y no pertinentes.<br>La presidencia letona de la UE ha destacado que la medida "se adapta a la nueva realidad y garantiza la protección de los datos personales de los ciudadanos dándoles mayor poder de decisión", al tiempo que ha considerado que aumentará la confianza en los servicios en línea y esto será positivo para las empresas, en especial para las pymes.', '2015-08-10 11:57:35', 'data:image/jpeg;base64,', 'admin', 'Noticia');
INSERT INTO `aporte` (`ID`, `TITULO`, `DESCRIPCION`, `F_CREACION`, `BASEIMG`, `PROPIETARIO`, `TIPO`) VALUES (4, 'Científicos vascos logran un hito en la lucha contra la leucemia', 'Un grupo de investigadores, en el que participa la Cátedra Interuniversitaria de Derecho y Genoma Humano de la UPV/EHU y de Deusto, descifra el genoma de más de 500 pacientes con leucemia e identifica mutaciones recurrentes en regiones no codificantes del genoma, que aporta nuevas claves para tratar ese cáncer.<br>Según ha informado la universidad pública vasca, la prestigiosa revista Nature ha publicado un trabajo que supone "un hito en la investigación científica en nuestro país, al haberse secuenciado los genomas de las células normales y tumorales de más de 500 pacientes con uno de los tumores más frecuentes, la leucemia linfática crónica".<br>Esta es la leucemia más frecuente en los países occidentales, con más de 1.000 nuevos pacientes diagnosticados cada año en España.<br>Conocer qué cambios genéticos provocan el desarrollo tumoral y cómo influyen en el desarrollo de la enfermedad es un paso fundamental para mejorar el tratamiento del cáncer, ha destacado la UPV/EHU.', '2015-08-10 12:00:45', 'data:image/jpeg;base64,', 'mjcd0005', 'Noticia');
INSERT INTO `aporte` (`ID`, `TITULO`, `DESCRIPCION`, `F_CREACION`, `BASEIMG`, `PROPIETARIO`, `TIPO`) VALUES (5, 'The Legend of Zelda Wii U, su fecha es un misterio para Nintendo', 'La fecha de lanzamiento de The Legend of Zelda para Wii U sigue siendo todo un misterio para Nintendo. La compañía continúa con sus dudas sobre cuándo se producirá la esperada llegada de Link a la consola de sobremesa tras su retraso indefinido.<br>Si sois usuarios de Wii U es muy posible que uno de los títulos que más estéis esperando para la consola sea el nuevo The Legend of Zelda. Como sabéis, hace no mucho que Nintendo anunció que la aventura protagonizada por Link se retrasaba hasta nuevo aviso. Pues bien, parece que Nintendo aún no tiene muy claro cuándo podría llegar el prometedor título a su consola. O al menos eso es lo que ha dejado ver la compañía al publicar su plan de lanzamientos a corto plazo.<br>', '2015-08-10 12:05:25', 'data:image/jpeg;base64,', 'mjcd0005', 'Noticia');
INSERT INTO `aporte` (`ID`, `TITULO`, `DESCRIPCION`, `F_CREACION`, `BASEIMG`, `PROPIETARIO`, `TIPO`) VALUES (6, 'Transferir dinero via Gmail', 'Google habilitó el servicio, integrado a la billetera electrónica Wallet.  Google ya puso en marcha una novedosa herramienta para sus usuarios: ahora permite la transferencia de dinero entre usuarios de Gmail.<br>El nuevo servicio, denominado Google Wallet (billetera) sólo se encuentra disponible por el momento en los Estados Unidos y el Reino Unido.<br>Según anunció la empresa, las operaciones no tienencosto si están asociadas a una cuenta bancaria, si se utiliza el saldo de Google Wallet, o si se emplea una tarjeta de débito, mientras que la operación con una tarjeta de crédito tiene una comisión de 2,9% por transacción.<br>El servicio es posible luego de la integración de la billetera electrónica Wallet con Gmail, y también está disponible para aquellos usuarios que no tengan una cuenta en el servicio de webmail de Google.<br>La herramienta está disponible sólo para la versión de escritorio, la transferencia de dinero sólo requiere pulsar la opciónAdjuntar dinero.', '2015-08-10 12:09:57', 'data:image/jpeg;base64,', 'uspr0017', 'Noticia');
